import { StyleSheet } from 'react-native';
import Contants from 'expo-constants'

const estiloInicial = StyleSheet.create({
   container: {   
      flex: 1,
      justifyContent: 'center',
      alignItems: 'center',     
      paddingTop: Contants.statusBarHeight,
   },
   containerC: {   
      flex: 1,
      justifyContent: 'center',
      paddingTop: Contants.statusBarHeight,
      alignItems: 'center',     
   },
   header: {
      height: 50,
      width: "100%",
      backgroundColor: '#9ac3f7',
      flexDirection: 'row',
      alignItems: 'center',
      justifyContent: "space-between",
      padding: 5
   },
   fundo: {   
      flexDirection: 'row',
      alignItems: 'center',
      justifyContent: 'space-evenly',
      width: '100%',
      height: '100%'
   },
   texto: {
      padding: 15,
      fontSize: 18,
      color: '#FFFFFF',
      fontWeight: "bold"
   },
   botaoBackground: {
      width: 140,
      height: 100,
      borderRadius: 10,
      overflow: 'hidden',
      justifyContent: 'flex-end',
      alignItems: 'center',
      padding: 10,
      borderWidth: 1,
      borderColor: '#14417b'
   },
   botaoTexto: {
      fontSize: 18,
      color: '#FFFFFF',
      fontWeight: 'bold'
   },
});

  export default estiloInicial;
